This Skeletor cosmetics bag is for all of the He-Man fans out there! I made it using cotton on the extrerior and a mint green cotton poplin lining. All the material was bought locally in Ireland. It&#39;s interfaced and padded for extra quality and the embrodered patch is sewn on to keep it secure. 
Dimensions:
H: 6&quot;
D: 3&quot;
W at the top: 8.5&quot;
W at the botton 5.5&quot;

